package StackArrays;import java.lang.reflect.Array;public class Main {    public static void main(String[] args) {        ArrayStack<Integer> st = new ArrayStack<>();        System.out.println("First Stack is Empty:"+ st.isEmpty());        st.push(10);        st.push(20);        st.push(30);        st.push(40);        System.out.println("The Size Stack is:" +st.siz());        st.pop();        System.out.println("After Pop Stack is:" +st.siz());        st.pee();        System.out.println("The Top Element Stack is:" +st.pee());    }}